sourcesContent:
import React from 'react';

class PreNavbar extends React.Component {
    render() {
        return (
            <div className="prenavbar">
                <i class="user fa fa-user"></i>
                <i class="more fa fa-align-justify"></i>
            </div>
        );
    }
}

class Navbar extends React.Component {
    render() {
        return (
            <div className="navbar">
                <img className="logo" src="https://files.slack.com/files-pri/T5S0K050F-FH4JM97FY/mytinerarylogo.png" alt="Page Logo" />
            </div>
        );
    }
}

class Content extends React.Component {
    render() {
        return (
            <div className="content">
                <p>Find your perfect trip, designed by insiders who <br></br>know and love their cities.</p>
                <div className="browsing">
                    <h1>Start browsing</h1>
                    <a href="..."><img className="start_icon" src="https://files.slack.com/files-pri/T5S0K050F-FH3FGRY85/circled-right-2.png" alt="Start Logo" width="80px" height="80px" /></a>
                </div>
            </div>
        );
    }
}

class SecondContent extends React.Component {
    render() {
        return (
            <div className="content2">
                <h1></h1>
            </div>
        );
    }
}

class Footer extends React.Component {
    render() {
        return (
            <footer className="footer">
                <p className="fooHeader">Want to build your own MYtinerary?</p>
                <a className="login" href="...">Log in</a>
                <a className="create" href="...">Create Account</a>
            </footer>
        );
    }
}

class SecondLandingPage extends React.Component {
    render() {
        return (
            <div>
                <PreNavbar />
                <Navbar />
                <Content />
            </div>
        );
    }
}

class LandingPage extends React.Component {
    render() {
        return (
            <div>
                <Navbar />
                <Content />
                <Footer />
            </div>
        );
    }
}

// export default LandingPage;
export default SecondLandingPage;
